import { ArrowBackIosNew, Edit } from "@mui/icons-material";
import {
  Button,
  Container,
  Divider,
  Grid,
  IconButton,
  Typography,
} from "@mui/material";
import { Box } from "@mui/system";
import React from "react";
import { useSelector } from "react-redux";
import { useHistory } from "react-router-dom";

const RSPHCMB = () => {
  const { data } = useSelector((state) => state.rsphcmb);
  const history = useHistory();

  return (
    <div>
      <Container>
        <Button
          onClick={() => history.goBack()}
          startIcon={<ArrowBackIosNew />}
        >
          Back
        </Button>
        <br />
        <br />
        <Typography variant="h6" gutterBottom>
          WHO WE ARE
        </Typography>
        <Divider />
        <Grid container spacing={2}>
          <Grid item sm={6} md={5}>
            <Box display="flex" flexDirection="column">
              {/* <img src={buildingCulture?.image} alt="" /> */}
              <Button sx={{ mt: 1, textTransform: "none" }} variant="contained">
                Update Image
              </Button>
              <br />
            </Box>
          </Grid>

          <Grid item sm={6} md={7}>
            <Box display="flex" flexDirection="column">
              <Box
                display="flex"
                flexDirection="row"
                justifyContent="space-between"
                alignItems="center"
              >
                <Typography>CONTENT</Typography>
                <IconButton>
                  <Edit />
                </IconButton>
              </Box>
              <Divider />
              <Typography>{data?.who_we_are}</Typography>
              <br />
            </Box>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default RSPHCMB;
